    handleOnclickLogin = (e) => {
        e.preventDefault();
        console.log(this.state.cart_closed)
        this.setState({ cart_closed: !this.cart_closed, });
        console.log(this.state.cart_closed)
    }

    render() {
        return (

            <nav className={"second-menu"} >
                <ul>
                    <li>
                        <Link to="/bookings">
                            <button className={""}>Bokningar</button>
